# Create the database
create database assignment_03_db;

# Use this database for these statements
use assignment_03_db;

# Create the students table
CREATE TABLE Students (
    StudentId int not null auto_increment,
    CollegeIdNumber varchar(255),
    LastName varchar(255) not null,
    FirstName varchar(255) not null,
    primary key (StudentId)
);

# Create the grade records table
CREATE TABLE GradeRecords (
    GradeRecordId int not null auto_increment,
    StudentId int not null,
    Division varchar(4) not null,
    CourseNumber int not null,
    GradeEarned varchar(1) not null,
    GPAWeight int not null,
    primary key (GradeRecordId),
    constraint FK_StudentId
    FOREIGN KEY (StudentId) REFERENCES Students(StudentId)
);

